import { filter } from "lodash";
import { Icon } from "@iconify/react";
import { sentenceCase } from "change-case";
import { useState, useEffect } from "react";
import plusFill from "@iconify/icons-eva/plus-fill";
import {
	Link as RouterLink,
	useNavigate,
} from "react-router-dom";
// material
import {
	Card,
	Table,
	Stack,
	Avatar,
	Button,
	Checkbox,
	TableRow,
	TableBody,
	TableCell,
	Container,
	Typography,
	TableContainer,
	TablePagination,
} from "@mui/material";
// components
import Page from "../../components/Page";
import Label from "../../components/Label";
import Scrollbar from "../../components/Scrollbar";
import SearchNotFound from "../../components/SearchNotFound";
import {
	UserListHead,
	UserListToolbar,
	UserMoreMenu,
} from "../../components/_dashboard/user";
//
import {
	getAllOrders,
	getOrder,
} from "../../service/OrderService";

const TABLE_HEAD = [
	{ id: "id", label: "Id", alignRight: false },
	{ id: "customer", label: "Customer", alignRight: false },
	{ id: "books", label: "Books", alignRight: false },
	{ id: "address", label: "Address", alignRight: false },
];

export default function Order() {
	const [page, setPage] = useState(0);
	const [rowsPerPage, setRowsPerPage] = useState(5);
	const [orders, setorders] = useState([
		{
			oid: 7,
			books: [
				{
					bid: 6,
					title: "hsukg",
					author: "jakjdbjk",
					price: 999.0,
					year: 2020,
					publisher: "hakhdi",
					cover: "jbjba",
					description: "jgdidiadnk",
					categoryName: null,
					category: {
						name: "Fantasy",
						id: 5,
					},
				},
			],
			address: {
				aid: 3,
				customerName: "sdsd",
				phoneNumber: "7889776055",
				pincode: "7889776055",
				mstate: "address",
				address: "7889776055",
				customerId: null,
			},
			customer: {
				cid: 1,
				fullName: "John",
				phoneNumber: "7889776055",
				address: [
					{
						aid: 3,
						customerName: "sdsd",
						phoneNumber: "7889776055",
						pincode: "7889776055",
						mstate: "address",
						address: "7889776055",
						customerId: null,
					},
					{
						aid: 4,
						customerName: "sdsasdasdd",
						phoneNumber: "dsa",
						pincode: "788977asdas6055",
						mstate: "asdasds",
						address: "asdads",
						customerId: null,
					},
				],
				orders: [],
			},
			tracking: "sdsasdasdd",
			status: "waiting",
			statusMsg: "waiting for approval",
			orderDate: "21/09/2021",
			price: 999.0,
			customerId: null,
			addressId: null,
			bookId: null,
		},
	]);
	const navigate = useNavigate();

	useEffect(() => {
		getAllOrders().then((_order) => {
			setorders(_order.data);
			console.log(orders);
		});
	}, []);

	const handleRequestSort = (event, property) => {};

	const handleSelectAllClick = (event) => {};

	const handleClick = (event, name) => {};

	const handleChangePage = (event, newPage) => {
		setPage(newPage);
	};

	const handleChangeRowsPerPage = (event) => {
		setRowsPerPage(parseInt(event.target.value, 10));
		setPage(0);
	};

	const handleFilterByName = (event) => {};

	const filteredUsers = orders;

	const isUserNotFound = false;

	return (
		<Page title="Order">
			<Container>
				<Stack
					direction="row"
					alignItems="center"
					justifyContent="space-between"
					mb={5}>
					<Typography variant="h4" gutterBottom>
						Orders
					</Typography>
				</Stack>

				<Card>
					{/* <UserListToolbar
            numSelected={selected.length}
            filterName={filterName}
            onFilterName={handleFilterByName}
          /> */}

					<Scrollbar>
						<TableContainer sx={{ minWidth: 800 }}>
							<Table>
								<UserListHead
									order={null}
									orderBy={null}
									headLabel={TABLE_HEAD}
									rowCount={orders.length}
									numSelected={0}
									onRequestSort={handleRequestSort}
									onSelectAllClick={handleSelectAllClick}
								/>
								<TableBody>
									{filteredUsers
										.slice(
											page * rowsPerPage,
											page * rowsPerPage + rowsPerPage
										)
										.map((row) => {
											const {
												id,
												customer,
												book,
												address,
											} = row;
											const isItemSelected = false;
											console.log(row);
											return (
												<TableRow
													hover
													key={id}
													tabIndex={-1}
													role="checkbox"
													selected={false}
													aria-checked={false}>
													<TableCell padding="checkbox">
														<Checkbox
															checked={false}
															onChange={() => {}}
														/>
													</TableCell>
													<TableCell
														component="th"
														scope="row"
														padding="none">
														<Stack
															direction="row"
															alignItems="center"
															spacing={2}>
															<Typography
																variant="subtitle2"
																noWrap>
																{id}
															</Typography>
														</Stack>
													</TableCell>
													<TableCell align="left">
														{customer}
													</TableCell>
													<TableCell align="left">
														sadsa
													</TableCell>
													<TableCell align="left">
														{address}
													</TableCell>
												</TableRow>
											);
										})}
								</TableBody>
							</Table>
						</TableContainer>
					</Scrollbar>

					<TablePagination
						rowsPerPageOptions={[5, 10, 25]}
						component="div"
						count={orders.length}
						rowsPerPage={rowsPerPage}
						page={page}
						onPageChange={handleChangePage}
						onRowsPerPageChange={handleChangeRowsPerPage}
					/>
				</Card>
			</Container>
		</Page>
	);
}
